import React, {useState} from 'react';
import Page from '../../components/Page/Page';
import styles from './AddJob.module.css';
import InputContainer from '../../components/InputContainer/InputContainer';

const NewJob = () => {
  return (
    <Page>
      <h1>Add job</h1>
      <form className={styles.Form}>
        <div className={styles.FormRow}>
          <InputContainer name="Job name" styleName={styles.JobName}>
            <label htmlFor="jobName"></label>
            <input id="jobName" minLength="3" type="text" />
          </InputContainer>
        </div>
        <div className={styles.FormRow}>
          <InputContainer name="Type" styleName={styles.JobType}>
            <label htmlFor="jobType"></label>
            <input id="jobType" minLength="3" type="text" />
          </InputContainer>
          <InputContainer name="Institution" styleName={styles.Institution}>
            <label htmlFor="institution"></label>
            <input id="institution" minLength="3" type="text" />
          </InputContainer>
          <InputContainer name="Location" styleName={styles.Location}>
            <label htmlFor="location"></label>
            <input id="location" minLength="3" type="text" />
          </InputContainer>
        </div>
      </form>
    </Page>
  );
};

export default NewJob;
